splits = [i.split(" => ")  for i in data]

def find(m, depth):
    if m == "e": yield depth
    for child, _ in sorted({(m[0:i] + p + m[i+len(q):], i)for i in range(len(m)) for p,q in splits if m[i:].startswith(q)}, key=lambda x: -x[1]):
        yield from find(child, depth+1)
